def box_plot_solutions(list_of_solutions, size_of_figures=(20,20),
                       nameOfFig = "comparation_box_plot"):
    '''
    Intro:
        This function creates a boxplot
        of a list of solutions.
    ---
    Input:
        list_of_solutions: List of single_run
            List containing the solutions of different methods.
        size_of_figures: Tuple of integers
            Controls boxplot image size.
        nameOfFig: String
            Name of the image to be saved.
    ---
    Output:
        The boxplot of solutions
        
    ''' 
    solutions_names = []
    execution_times = []
    convergences = []
    diversities = []
    hypervolumes = []
    for s in list_of_solutions:
        name = s.methodName
        solutions_names.append(name)
        execution_times.append(s.execution_time)
        convergences.append(s.list_convergence)
        diversities.append(s.list_diversity)
        hypervolumes.append(s.hypervolume)
        
    fig, axes = plt.subplots(2,2) # create figure and axes
    fig.set_size_inches(size_of_figures[0], size_of_figures[1])
    
    df = pd.DataFrame(np.array(execution_times).T, columns=solutions_names)
    a = df.boxplot(ax=axes[0,0])
    a.title.set_text('Execution Time (s)')
    
    df = pd.DataFrame(np.array(convergences).T, columns=solutions_names)
    a=df.boxplot(ax=axes[0,1])
    a.title.set_text('Convergence')
    
    df = pd.DataFrame(np.array(diversities).T, columns=solutions_names)
    a=df.boxplot(ax=axes[1,0])
    a.title.set_text('Diversity')
    
    df = pd.DataFrame(np.array(hypervolumes).T, columns=solutions_names)
    a=df.boxplot(ax=axes[1,1])
    a.title.set_text('Hypervolumes')
    
    plt.tight_layout() 
    plt.savefig(nameOfFig+'.png')
    plt.show()


