def createFakePoints(n, BOUND_LOW=0.0, BOUND_UP=1.0, NDIM=30, seed=None):
    '''
    Intro:
        This data comes from a Gaussian uniform variation
        for the function deap.benchmarks.zdt1
    ---
    Inputs: 
        n: Integer
            is the number of points that we want to receive.
        BOUND_LOW: Float
            Lower value limit of each position
        BOUND_UP: Float
            Upper value limit of each position
        NDIM: Integer
            Size of each individual.
        seed: Integer
            Seed for random process.
    ---
    Outputs:
        A list of 100 points of dimension 30 with values between [0, 1].
        Each point is a list.
    '''   
    random.seed(seed)
    
    result_data = []
    for i in range(n):
        temp_list = uniform(BOUND_LOW,BOUND_UP,30,seed)
        result_data += [temp_list]
    
    return result_data


