class single_solution:
    '''
    Intro:
        Class used to avaliate one method over one function
    '''   
    def __init__(self, methodName, function_name, number_of_runs,
                 numberOfPersons, iters, refpointToHyperV, identif,
                 pareto_front, obj,good_points=None,
                 bad_points=None,
                 lb=0.0, ub=1.0,dim=30):
        
        # Identifier
        self.id = identif
        
        # Parameters
        self.methodName = methodName
        self.function_name = function_name
        self.good_points = good_points
        self.bad_points = bad_points
        self.number_of_runs = number_of_runs
        self.numberOfPersons = numberOfPersons
        self.iters = iters
        self.refpointToHyperV = refpointToHyperV
        self.pareto_front = pareto_front
        self.obj = obj
        
        # Statistics
        self.list_convergence = []
        self.list_diversity = []
        self.execution_time = []
        self.hypervolume = []
                
        # Best pop by convergence*diversity
        self.bestStats = -1
        self.bestcd = (-1,-1)
        self.bestPop = None
        
        # Restrictions
        self.lb = lb
        self.ub = ub
        self.dim = dim
        
    def add_one_run(self, pop, executionTime, hv=True):
        '''
        Intro:
            Function that adds the results of a run to 
            the solution list and calculates all metrics.
        ---
        Inputs: 
            pop: List
                List of individuals.
            executionTime: Float
                Execution time of execution.
            hv:Â Boolean
                True to the need to calculate Hypervolume,
                False otherwise
        '''   
        found_front = [list(self.obj(x)) for x in pop]
        found_front.sort()
        (c, d) = (convergence(found_front, self.pareto_front),diversity(found_front, self.pareto_front[0], self.pareto_front[-1]))
        self.list_convergence.append(c)
        self.list_diversity.append(d)
        self.execution_time.append(executionTime)
        
        if hv:
            hv = pg.hypervolume(found_front)
            self.hypervolume.append( hv.compute(self.refpointToHyperV, hv_algo=pg.hvwfg()))
            
        if(self.bestStats < c*d):
            self.bestStats = c*d
            self.bestPop = pop
        elif(self.bestcd == c*d and c+d < sum(self.bestcd)):
            self.bestcd = (c,d)
            self.bestPop = pop
            
    def returnMeanValues(self, hv=True):
        '''
        Intro:
            Function that averages the statistics
        ---
        Inputs: 
            hv: Boolean
                True if you want to return HyperVolume (if calculated)
        ---
        Outputs:
            Returns the average values of all 
            measurements for all added run statistics
        '''
        (t,c,d) = (sum(self.execution_time)/len(self.execution_time),
              sum(self.list_convergence)/len(self.list_convergence),
             sum(self.list_diversity)/len(self.list_diversity))
        if hv:
            h = sum(self.hypervolume)/len(self.hypervolume)
            return (t,c,d,h)
        else:
            return (t,c,d)


