class multiple_solution:
    '''
    Intro:
        Class used to store and to avaliate many methods over many function
    ---
    Inputs:
        dimension_of_methodMatrix : Tuple
            With number of value of (name_of_functions, good_points, total_points, group_persons,iters)
        name_of_each_parameter : Tuple
            With names of each element of tuple_with_nparameters, to use in dictOfValuesToPosition to get
            dict of positions of that parameter
    '''  
    def __init__(self,folderpathToData,
                 number_of_runs,
                 dimension_of_methodMatrix, name_of_each_parameter,
                 dictOfValuesToPosition):
        
        self.folderpathToData = folderpathToData
        self.dict_of_solutions = {}
        self.number_of_runs = number_of_runs
        self.dimension_of_methodMatrix = dimension_of_methodMatrix
        self.name_of_each_parameter = name_of_each_parameter
        self.dictOfValuesToPosition = dictOfValuesToPosition
        
    def add_single_solution(self, methodName, ssolution):
        '''
        Intro:
            Function that adds object of class single_solution
            to multiple_solution
        ---
        Inputs: 
            methodName: String
                Method Name.
            ssolution : single_solution
                single_solution to add.
        '''
        positionOfSolution = self.positionOfSingleSolution(ssolution)
        if methodName in self.dict_of_solutions:
            self.dict_of_solutions[methodName][positionOfSolution] = ssolution
        else:
            # Label of function name (if exists)
            self.dict_of_solutions = {methodName : np.empty(self.dimension_of_methodMatrix,dtype=single_solution)}
            self.dict_of_solutions[methodName][tuple(positionOfSolution)] = ssolution
            
    def positionOfSingleSolution(self, ssolution):
        '''
        Intro:
            Function that returns the position of a
            single_solution in the matrix of all solutions.
        ---
        Inputs:
            ssolution : single_solution
                single_solution to add.
        ---
        Outputs:
            Returns a list of single_solution position
        '''
        posList = []
        for i in range(len(ssolution.id)):
            pos  = self.dictOfValuesToPosition[self.name_of_each_parameter[i]][ssolution.id[i]]
            posList.append(pos)
        return posList
            
    def save_all_methods(self):
        '''
        Intro:
            Method that saves the solution matrix
        '''
        if not os.path.exists(self.folderpathToData):
            os.makedirs(self.folderpathToData)
            
        for key in self.dict_of_solutions.keys():
            path = self.folderpathToData + "/" + key
            np.save(path, self.dict_of_solutions[key])
        
    def load_all_methods(self):
        '''
        Intro:
            Method that loads the solution matrix
        '''
        if not os.path.exists(self.folderpathToData):
            raise Exception('Folder doesn\'t exist')
        else:
            self.dict_of_solutions = {}
            files = getAllFilesOfExtension(self.folderpathToData,"npy")
            for f in files:
                array = np.load(self.folderpathToData+"/"+f,allow_pickle=True)
                self.dict_of_solutions.update({f.replace(".npy","") :
                                             array})
                
    def loadOneSolution(self, method, identifier):
        '''
        Intro:
            Function to retrieve a single_solute
            from the solution matrix.
        ---
        Inputs:
            method: String
                Method Name.
            identifier: List
                single_solution identifier
        ---
        Outputs:
            Returns single_solution
        '''
        posList = []
        for i in range(len(identifier)):
            pos  = self.dictOfValuesToPosition[self.name_of_each_parameter[i]][identifier[i]]
            posList.append(pos)
        return self.dict_of_solutions[method][tuple(posList)]


