class paretoInputSet:
    '''
    Intro:
        Class that holds specific values from only one
        multi-objective function
    '''   
    def __init__(self,function_name, measureNames):
        
        self.function_name = function_name
        self.dictOfPoints = {}
        self.dictOfMeasureValues = {}
        self.MeasureNames = measureNames
        
            
    def setNewData(self, matrix, listMeasureValues):
        '''
        Intro:
            Add new dataset that gives a pareto front
            (by the multi-objective optimization function)
        ---
        Inputs:
            matrix: List of list
                All points whose output (by the multi-objective
                optimization function) is the pareto front.
            listMeasureValues: List
                List with values of each metric
            
        '''
        self.dictOfPoints.update({len(matrix) : matrix})
        if len(listMeasureValues.keys()) != len(self.MeasureNames):
            raise Exception('Number of measures and number of values must have the same size')
        
        for key in listMeasureValues.keys():
            if key not in self.MeasureNames:
                raise Exception('Name ' + key+ ' not in measureNames')
                
        self.dictOfMeasureValues.update({len(matrix) : listMeasureValues})
        


